import React, { Component } from 'react';
import './About.css';

/**
 * Class to handle the rendering of the Home page.
 * @extends React.Component
 */
export default class Home extends Component {
  render() {
    return (
      <div className="About container">
        <h1>About</h1>
        <br></br>
        <p>
          FREZZ is a website application that can be used to help and facilitate supermarkets or fruit farmers in Indonesia in choosing fruit
           with the best quality, for now FREZZ can only be used to classify fruits such as bananas, apples and oranges. This application can
          <br></br>
          <br></br>
          FREZZ sendiri dibuat dan dikembangkan oleh orang-orang dibawah ini:
          <ul>
            <li><strong>Alyza Rahima Pramudya</strong></li>
            <li><strong>Dierta Pasific</strong></li>
            <li><strong>Jacqueline Abyasa</strong></li>
            <li><strong>Shafara Amira Qonitatin</strong></li>
          </ul>
          Honorable mention to Bangkit Academy program from Google in collaboration with Gojek, Tokopedia, and Traveloka to provide capable technical talent in Machine Learning.
        </p>
        <p>
          You can check this awesome webapp in this <a href="https://github.com/sanggusti/final_bangkit">link</a> and awesome template in this <a href="https://github.com/IBM/tfjs-web-app#3-download-and-convert-pre-trained-model">link</a>
        </p>
      </div>
    );
  }
}
